import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Layout from './Components/Layout/Layout';
import Buy from './Components/Buy/Buy';

function App() {
  return (
    <>
    <BrowserRouter>
      <Routes>
          <Route path="/" element={<Layout/>}>
              <Route path='/buy' element={<Buy/>}/>
          </Route>
      </Routes>
    </BrowserRouter>

    </>
  );
}

export default App;
